$(document).ready(function(){
	$("#titles").click(function(){
		$("#list").slideToggle();
		$("#shahid").fadeToggle();
		$("#ads").slideToggle();
		$("#rspm").toggleClass("after");
	});
	$("#title-border").mouseleave(function(){
		$("#list").slideUp("slow");
		$("#shahid").fadeIn("slow");
		$("#ads").slideDown();
		$("#rspm").removeClass("after");
	});
});

var $mouseX = 0, $mouseY = 0;
var $xp = 0, $yp =0;

$(document).mousemove(function(e){
	$mouseX = e.pageX;
	$mouseY = e.pageY;
});

var $loop = setInterval(function(){
// change 12 to alter damping higher is slower
$xp += (($mouseX - $xp)/12);
$yp += (($mouseY - $yp)/12);
$("#ostan").css({left:$xp+8 +'px', top:$yp-25 +'px'});
}, 30);

