function showman(str) {
	var xmlhttp = new XMLHttpRequest();
	xmlhttp.onreadystatechange = function() {
		if (xmlhttp.readyState == 4 && xmlhttp.status == 200) {
			document.getElementById("man").innerHTML = xmlhttp.responseText;
		}
	}
	xmlhttp.open("GET", "/include/ajax/img-man.php?q=" + str, true);
	xmlhttp.send();
}
function showwoman(str) {
	var xmlhttp = new XMLHttpRequest();
	xmlhttp.onreadystatechange = function() {
		if (xmlhttp.readyState == 4 && xmlhttp.status == 200) {
			document.getElementById("woman").innerHTML = xmlhttp.responseText;
		}
	}
	xmlhttp.open("GET", "/include/ajax/img-woman.php?q=" + str, true);
	xmlhttp.send();
}






